angular.module('app.controllers')
    .controller('ProfileCtrl', function($scope, $ionicModal, $state, $localstorage, $http, $ionicPopup, $stateParams) {
        $ionicModal.fromTemplateUrl('templates/social/skills.html', {
            scope: $scope
        }).then(function(modal) {
            $scope.skillsModal = modal;
        });

        function cameraCapture() {
            navigator.camera.getPicture(onPhotoDataSuccess, onFail, {
                quality: 50,
                destinationType: navigator.camera.DestinationType.DATA_URL,
                correctOrientation: true
            });
        }

        function photoSelect() {
            navigator.camera.getPicture(onPhotoURISuccess, onFail, {
                quality: 1,
                destinationType: navigator.camera.DestinationType.FILE_URI,
                sourceType: navigator.camera.PictureSourceType.PHOTOLIBRARY
            });
        }

        function onPhotoDataSuccess(imageData) {
            $scope.profileImg = imageData;
            var user = $localstorage.getObject('user');
            user.profileImg = imageData;
            // user.position = (new Date()).toString();
            $localstorage.setObject('user', user);
            $scope.user = user;
            $http.post('https://kinsheep.com:3030/edit_user?id=' + user._id, user).then(function(resp) {
                console.log("Profile Img Updated");
            });
        }

        function onPhotoURISuccess(imageURI) {
            function convertFileToBase64viaFileReader(url, callback) {
                var xhr = new XMLHttpRequest();
                xhr.responseType = 'blob';
                xhr.onload = function() {
                    var reader = new FileReader();
                    reader.onloadend = function() {
                        callback(reader.result);
                    };
                    reader.readAsDataURL(xhr.response);
                };
                xhr.open('GET', url);
                xhr.send();
            }

            function dataImageToImageURI(dataImage) {
                var splitIndex = dataImage.indexOf(',');
                return dataImage.substr(splitIndex + 1);
            }

            function processDataImage(dataImage) {
                onPhotoDataSuccess(dataImageToImageURI(dataImage));
            }

            convertFileToBase64viaFileReader(imageURI, processDataImage);
        }

        function onFail(message) {
            alert("Something went wrong :(");
        }

        $scope.capturePic = function() {
            cameraCapture();
        };
        $scope.choosePic = function() {
            photoSelect();
        };
        $scope.openSkills = function() {
            $scope.skillsModal.show();
        };
        $scope.closeSkills = function() {
            $scope.skillsModal.hide();
        };
        $scope.getUser = function() {
            return $localstorage.getObject('user');
        };
        $scope.user = $scope.getUser();

        $scope.defProfileImg = "";

        $scope.update = function(settings) {
            var savePopup = $ionicPopup.confirm({
                title: 'Confirmation',
                template: 'Do you want to save your details?',
                cancelType: 'button-assertive'
            });
            savePopup.then(function(res) {
                if (res) {
                    var user = $localstorage.getObject('user');
                    user.position = settings.position || user.position;
                    user.firm = settings.firm || user.firm;
                    user.pitch = settings.pitch || user.pitch;
                    // $http.post('https://kinsheep.com:3030/edit_user?id=' + user._id + '&position=' + position + '&firm=' + firm + '&pitch=' + pitch).then(function(resp) {
                    //     console.log("Settings updated");
                    // });
                    $http.post('https://kinsheep.com:3030/edit_user?id=' + user._id, user).then(function(resp) {
                        console.log("Settings updated");
                    });
                    $localstorage.setObject('user', user);
                    console.log("Saved!");
                } else {
                    console.log("Not Saved");
                }
            });
        };
        $scope.create = function(settings) {
            settings = settings || {};
            if (!(settings.firstName && settings.lastName && settings.position && settings.firm)) {
                $scope.error = "All fields need to filled up.";
                return;
            }
            var user = $scope.getUser();
            var firstName = settings.firstName || "Buggy";
            var lastName = settings.lastName || "Bugged";
            var position = settings.position || "Resident Bug";
            var firm = settings.firm || "The Hive";
            var pitch = settings.pitch || "Hi my name is " + firstName + " " + lastName + ". I am a " + position + " at " + firm + ".";
            $http.get('https://kinsheep.com:3030/add_user?email=' + $stateParams.email + '&password=' + $stateParams.password + '&firstName=' + firstName + '&lastName=' + lastName + '&position=' + position + '&firm=' + firm + '&pitch=' + pitch).then(function(resp) {
                console.log("Welcome complete");
                $localstorage.setObject('user', resp.data);
                $state.go('app.main');
            });
        };
    });
